package main

import (
    "fmt"
    "sort"
)

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}
func arrayPairSum(nums []int) int {
    N := len(nums)
    sort.Ints(nums)
    i, j := 0, 1
    res := 0
    for j < N {
        res += min(nums[i], nums[j])
        i += 2
        j += 2
    }
    return res
}

